import React from 'react';
import FormComponent3 from '../../components/FormComponent3'

// Subject data array
const subjectsData = [
  {
    name: "Clinical Neurology",
    theoryMax: 150,
    theoryMin: 75,
    theorySecured: '',
    practicalMax: 50,
    practicalMin: 25,
    practicalSecured: '',
    totalMax: 200,
    totalMin: 100,
    result: 'Fail'
  },
  {
    name: "Clinical Orthopedics",
    theoryMax: 150,
    theoryMin: 75,
    theorySecured: '',
    practicalMax: 50,
    practicalMin: 25,
    practicalSecured: '',
    totalMax: 200,
    totalMin: 100,
    result: 'Fail'
  },
  {
    name: "Clinical Cardio-thoracic Surgery",
    theoryMax: 100,
    theoryMin: 50,
    theorySecured: '',
    practicalMax: 50,
    practicalMin: 25,
    practicalSecured: '',
    totalMax: 150,
    totalMin: 75,
    result: 'Pass'
  }
];

// Functional component to render the form
const BPT6Semester = () => {
  return (
    <FormComponent3
      title="6 Semester Final Examination (BPT)"
      subjectsData={subjectsData}
    />
  );
};

export default BPT6Semester ;
